<br>Several years later, the demon is revived. Our present-day protagonist, Dai, lives on a remote island in the southern seas and dreams of becoming a great hero. When he hears about the demon', CHAR(39), 's revival, Dai and his friends take it upon themselves to stop him and the evil force that revived him. Along the way, Dai discovers the identity of "the hero," the truth behind the evil force who revived the demon, and Dai', CHAR(39), 's own hidden powers that surface in times of peril.<br>
